import { Fragment } from "react";
import Card from "@mui/material/Card"
import { Box } from "@mui/material/Box";


const ListTask = ({task}) => {
    return(
        <Fragment>
        <div id="external-event">
            {
                task.map((singleTask, index)=> (
                    <Card
                    key={index}
                    className="fc-event"
                    title={singleTask.nombre}
                    id={singleTask.idus}
                    color={singleTask.color}
                    sx={{
                        display:"flexible",
                        width: "100%"
                    }}
                    variant="outlined">
                     <Box
                        sx={{flexDirection: "column", width:"90%"}}>

                     </Box>
                     <Box
                        sx={{flexDirection: "column", width:"10%", bgColor:`#${singleTask.color}`}}>
                     </Box>
                    </Card>
                ))
            }
        </div>
        </Fragment>
    )
}
export default ListTask;
